import styled from "styled-components";
import { BiChevronDown } from "react-icons/bi";
import { CiSearch } from "react-icons/ci";
import { RxPerson } from "react-icons/rx";
import { BiShoppingBag } from "react-icons/bi";

const Navbar = () => {
  const Btn = styled.button`
    background-color: #eb6d20;
    color: #fff;
    font-size: 15px;
    padding: 5px 20px 5px 20px;
    border-radius: 20px;
    width: 4.5rem;
    height: 2rem;
    @media (max-width: 1024px) {
      padding: 0 18px 0 18px;
      margin-left: 10rem;
    }
  `;
  return (
    <nav className=' w-[94%] max-w-7xl m-auto'>
      <div className='flex pt-5 space-x-4 items-center max-lg:space-x-4'>
        <img
          className=''
          src='/images/Logo.png'
          alt='logo'
        />

        <div className='bg-white flex text-sm bg-transparent px-1 py-1 w-[45rem] h-10 rounded-3xl max-lg:pl-0  max-lg:w-[28rem]'>
          <div className='bg-[#F5F6F8] px-3 pl-5 text-base font-normal rounded-3xl flex items-center gap-1 w-[12rem] cursor-pointer hover:bg-[#dddddd] max-lg:w-[34%] max-lg:text-[14.5px] max-lg:px-3 max-lg:ml-1'>
            All categories
            <BiChevronDown className='text-xl cursor-pointer' />
          </div>
          <input
            type='text'
            name='Search'
            placeholder='Search anything'
            className='text-center w-[40rem] ml-4 rounded-3xl max-lg:w-[17rem]'
          />
          <CiSearch className='text-3xl cursor-pointer max-lg:text-3xl max-lg:pt-1  max-lg:pl-1' />
          </div>

        {/* <div className="flex space-x-5 max-lg:order-1 max-lg:place-self-end"> */}
        <Btn className='hover:bg-[#d96117] '>Help</Btn>
        <div className='flex items-center gap-2 text-[15.9px] cursor-pointer hover:underline max-lg:gap-1 max-lg:pl-2 max-lg:pr-5'>
          <RxPerson className='text-lg hover:text-red-400 cursor-pointer' />
          Account
        </div>
        <div className='flex items-center gap-2 text-[15.9px] cursor-pointer hover:underline  max-lg:pl-0'>
          <BiShoppingBag className='text-lg hover:text-red-400 cursor-pointer' />
          Shopping
        </div>
        </div>


      {/* </div> */}

      {/* lineTwo */}

      <div className='lineTwo'>
        <ul className='flex space-x-14 pl-32 pt-7 text-[15.1px]  max-lg:text-[14.5px]  max-lg:pl-[3%]  max-lg:text-center  max-lg:space-x-10  max-lg:w-[62rem]'>
          <li className='pb-4 border-[#FFF9F3] border-b-2 cursor-pointer hover:text-[#eb6d20] hover:border-b-2 hover:border-b-[#eb6d20]'>
            Jewelry & Accessories
          </li>
          <li className='pb-4 border-[#FFF9F3] border-b-2 cursor-pointer hover:text-[#eb6d20] hover:border-b-2 hover:border-b-[#eb6d20]'>
            Clothing & Shoes
          </li>
          <li className='pb-4 border-[#FFF9F3] border-b-2 cursor-pointer hover:text-[#eb6d20] hover:border-b-2 hover:border-b-[#eb6d20]'>
            Home & Living
          </li>
          <li className='pb-4 border-[#FFF9F3] border-b-2 cursor-pointer hover:text-[#eb6d20] hover:border-b-2 hover:border-b-[#eb6d20]'>
            Wedding & Party
          </li>
          <li className='pb-4 border-[#FFF9F3] border-b-2 cursor-pointer hover:text-[#eb6d20] hover:border-b-2 hover:border-b-[#eb6d20]'>
            Toys & Entertainment
          </li>
          <li className='pb-4 border-[#FFF9F3] border-b-2 cursor-pointer hover:text-[#eb6d20] hover:border-b-2 hover:border-b-[#eb6d20]'>
            Art & Collectibles
          </li>
          <li className='pb-4 border-[#FFF9F3] border-b-2 cursor-pointer hover:text-[#eb6d20] hover:border-b-2 hover:border-b-[#eb6d20]'>
            Craft Supplies & Tools
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
